To create a Chrome extension that takes screenshots of web pages, you'll need to create a few files:

1. `manifest.json`: This file contains metadata about your extension, such as its name, description, and permissions.
2. `popup.html`: This file contains the HTML for the popup that will appear when the user clicks the extension's icon.
3. `popup.js`: This file contains the JavaScript code that will run when the popup is opened.
4. `screenshot.js`: This file contains the JavaScript code that will take the screenshot.

Here's an example of how you can create these files:

**manifest.json**
```json
{
  "manifest_version": 2,
  "name": "Screenshot Extension",
  "version": "1.0",
  "description": "A Chrome extension that takes screenshots of web pages",
  "permissions": ["activeTab"],
  "browser_action": {
    "default_popup": "popup.html"
  }
}
```
**popup.html**
```html
<!DOCTYPE html>
<html>
  <head>
    <title>Screenshot Extension</title>
    <style>
      body {
        font-family: Arial, sans-serif;
        width: 200px;
        height: 100px;
        font-size: 14px;
        text-align: center;
        padding: 20px;
        border: 1px solid #ccc;
        border-radius: 5px;
        box-shadow: 0px 0px 10px rgba(0,0,0,0.2);
      }
    </style>
  </head>
  <body>
    <h1>Screenshot Extension</h1>
    <button id="take-screenshot">Take Screenshot</button>
    <script src="popup.js"></script>
  </body>
</html>
```
**popup.js**
```javascript
document.addEventListener("DOMContentLoaded", function () {
  const takeScreenshotButton = document.getElementById("take-screenshot");
  takeScreenshotButton.addEventListener("click", function () {
    chrome.tabs.query({ active: true, currentWindow: true }, function (tabs) {
      chrome.tabs.sendMessage(tabs[0].id, { action: "take_screenshot" });
    });
  });
});
```
**screenshot.js**
```javascript
chrome.runtime.onMessage.addListener(function (request, sender, sendResponse) {
  if (request.action === "take_screenshot") {
    chrome.tabs.captureVisibleTab(null, { format: "png" }, function (dataUrl) {
      const link = document.createElement("a");
      link.href = dataUrl;
      link.download = "screenshot.png";
      link.click();
    });
  }
});
```
